const AboutUs =() =>{
    return (
        <div class="md:h-[40vh] lg:h-[75vh] h-[30%] mt-12 bg-orange-50 w-[96%] ml-[2%] pt-10">
            <div class="text-extrabold">
                <p>About Us</p>
            </div>
            <div class="w-[60%] bg-white pl-4 ">
                <p>
                Welcome to <hn class="text-orange-700" >FlavZ</hn> the ultimate destination for culinary enthusiasts and home cooks! Our platform is designed with a passion for good food and the joy of sharing delicious recipes with a community of like-minded individuals.
                </p>
            </div>
        </div>
    )
};
export default AboutUs ;
